import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Cards";
import "./index.css";
import Sdata from "./Sdata";
ReactDOM.render(
  <>
  <h1 className='heading_style'>List Of top 5 Netflix Seriesin 2020 </h1>

<Card title={Sdata[0].title}
imgsrc={Sdata[0].imgsrc}

    sname={Sdata[0].sname} 
    link={Sdata[0].links}/>
  </>  

     ,document.getElementById('kumar')

);
